import React from 'react';
import styled from 'styled-components';

const RepeatEach = () => {
  const Section = styled.section`
    border: 1px red solid;
    width: 375px;
    height: 100px;
    margin: auto;
    display: flex;
    align-items: center;
  `;

  const Label = styled.label`
    margin-left: 20px;
  `;

  return (
    <Section>
      <Label>Repetir cada</Label>
      <Input type="text"/>
    </Section>
  )
}

export default RepeatEach
